INSERT INTO `wp_posts` VALUES (1,1,'2018-09-08 19:38:19','2018-09-08 19:38:19','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas ex ligula, rutrum vitae ante id, luctus malesuada magna. Nunc posuere scelerisque lectus, tempor feugiat neque pharetra ac. Mauris pellentesque sem nec porttitor pretium. Mauris euismod, odio eu laoreet sollicitudin, arcu lacus rhoncus massa, quis ultrices elit magna ac ipsum. Ut dapibus condimentum dignissim. Sed a dui ex. Praesent mollis quam magna. Proin convallis dignissim erat, non bibendum metus lacinia ut. Suspendisse non vulputate orci.\r\n\r\nAenean at mauris semper, luctus ipsum ut, pretium urna. Vivamus sodales, arcu semper gravida imperdiet, metus diam venenatis tellus, in volutpat mauris est sed justo. Aliquam non tortor ac sapien accumsan scelerisque non nec lacus. Mauris sodales lacus vitae commodo elementum. Integer at justo massa. Morbi volutpat eros id ante elementum, sed lobortis nulla vestibulum. Phasellus vitae elit in ligula pulvinar rhoncus quis eu risus. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Maecenas at auctor arcu. Nulla mattis sodales erat vel pellentesque. Fusce ut convallis neque, laoreet ornare lectus. Pellentesque pulvinar lacus dolor, eu pulvinar arcu ornare a.','Post 1','','publish','open','open','','post-1','','','2018-09-25 00:44:34','2018-09-25 00:44:34','',0,'http://localhost/wp/?p=1',0,'post','',1),(2,1,'2018-09-08 19:38:19','2018-09-08 19:38:19','Esta es una pgina de ejemplo, Es diferente a una entrada de blog porque se mantiene esttica y se mostrar en la barra de navegacin (en la mayora de temas). Casi todo el mundo comienza con una pgina Acerca de m para presentarse a los potenciales visitantes. Podra ser algo as:\n\n<blockquote>Hola!: Soy mensajero por el da, aspirante a actor por la noche y esta es mi web. Vivo en Madrid, tengo perrazo llamado Juan y me encantan las pias coladas (y que me pille un chaparrn)</blockquote>\n\n o algo as:\n\n<blockquote>La empresa Calcetines XYZ se fund en 1971, y ha estado produciendo calcetines de calidad para sus clientes desde entonces. Ubicada en Gothan, la empresa XYZ tiene ms de 2.000 empleados e intenta ayudar en lo que puede para mejorar la vida en Gothan</blockquote>\n\nSi eres nuevo en WordPress deberas ir a <a href=\"http://localhost/wp/wp-admin/\">tu escritorio</a> para borrar esta pgina y crear algunas nuevas con tu contenido. Psalo bien!','Pgina de ejemplo','','publish','closed','open','','pagina-ejemplo','','','2018-09-08 19:38:19','2018-09-08 19:38:19','',0,'http://localhost/wp/?page_id=2',0,'page','',0),(3,1,'2018-09-08 19:38:19','2018-09-08 19:38:19','<h2>Quines somos</h2><p>La direccin de nuestra web es: http://localhost/wp.</p><h2>Qu datos personales recogemos y por qu los recogemos</h2><h3>Comentarios</h3><p>Cuando los visitantes dejan comentarios en la web, recopilamos los datos que se muestran en el formulario de comentarios, as como la direccin IP del visitante y la cadena de agentes de usuario del navegador para ayudar a la deteccin de spam.</p><p>Una cadena annima creada a partir de tu direccin de correo electrnico (tambin llamada hash) puede ser proporcionada al servicio de Gravatar para ver si la ests usando. La poltica de privacidad del servicio Gravatar est disponible aqu: https://automattic.com/privacy/. Despus de la aprobacin de tu comentario, la imagen de tu perfil es visible para el pblico en el contexto de su comentario.</p><h3>Medios</h3><p>Si subes imgenes a la web deberas evitar subir imgenes con datos de ubicacin (GPS EXIF) incluidos. Los visitantes de la web pueden descargar y extraer cualquier dato de localizacin de las imgenes de la web.</p><h3>Formularios de contacto</h3><h3>Cookies</h3><p>Si dejas un comentario en nuestro sitio puedes elegir guardar tu nombre, direccin de correo electrnico y web en cookies. Esto es para tu comodidad, para que no tengas que volver a rellenar tus datos cuando dejes otro comentario. Estas cookies tendrn una duracin de un ao.</p><p>Si tienes una cuenta y te conectas a este sitio, instalaremos una cookie temporal para determinar si tu navegador acepta cookies. Esta cookie no contiene datos personales y se elimina al cerrar el navegador.</p><p>Cuando inicias sesin, tambin instalaremos varias cookies para guardar tu informacin de inicio de sesin y tus opciones de visualizacin de pantalla. Las cookies de inicio de sesin duran dos das, y las cookies de opciones de pantalla duran un ao. Si seleccionas &quot;Recordarme&quot;, tu inicio de sesin perdurar durante dos semanas. Si sales de tu cuenta, las cookies de inicio de sesin se eliminarn.</p><p>Si editas o publicas un artculo se guardar una cookie adicional en tu navegador. Esta cookie no incluye datos personales y simplemente indica el ID del artculo que acabas de editar. Caduca despus de 1 da.</p><h3>Contenido incrustado de otros sitios web</h3><p>Los artculos de este sitio pueden incluir contenido incrustado (por ejemplo, vdeos, imgenes, artculos, etc.). El contenido incrustado de otras web se comporta exactamente de la misma manera que si el visitante hubiera visitado la otra web.</p><p>Estas web pueden recopilar datos sobre ti, utilizar cookies, incrustar un seguimiento adicional de terceros, y supervisar tu interaccin con ese contenido incrustado, incluido el seguimiento de tu interaccin con el contenido incrustado si tienes una cuenta y ests conectado a esa web.</p><h3>Analtica</h3><h2>Con quin compartimos tus datos</h2><h2>Cunto tiempo conservamos tus datos</h2><p>Si dejas un comentario, el comentario y sus metadatos se conservan indefinidamente. Esto es para que podamos reconocer y aprobar comentarios sucesivos automticamente en lugar de mantenerlos en una cola de moderacin.</p><p>De los usuarios que se registran en nuestra web (si los hay), tambin almacenamos la informacin personal que proporcionan en su perfil de usuario. Todos los usuarios pueden ver, editar o eliminar su informacin personal en cualquier momento (excepto que no pueden cambiar su nombre de usuario). Los administradores de la web tambin pueden ver y editar esa informacin.</p><h2>Qu derechos tienes sobre tus datos</h2><p>Si tienes una cuenta o has dejado comentarios en esta web, puedes solicitar recibir un archivo de exportacin de los datos personales que tenemos sobre ti, incluyendo cualquier dato que nos hayas proporcionado. Tambin puedes solicitar que eliminemos cualquier dato personal que tengamos sobre ti. Esto no incluye ningn dato que estemos obligados a conservar con fines administrativos, legales o de seguridad.</p><h2>Dnde enviamos tus datos</h2><p>Los comentarios de los visitantes puede que los revise un servicio de deteccin automtica de spam.</p><h2>Tu informacin de contacto</h2><h2>Informacin adicional</h2><h3>Cmo protegemos tus datos</h3><h3>Qu procedimientos utilizamos contra las brechas de datos</h3><h3>De qu terceros recibimos datos</h3><h3>Qu tipo de toma de decisiones automatizada y/o perfilado hacemos con los datos del usuario</h3><h3>Requerimientos regulatorios de revelacin de informacin del sector</h3>','Poltica de privacidad','','draft','closed','open','','politica-privacidad','','','2018-09-08 19:38:19','2018-09-08 19:38:19','',0,'http://localhost/wp/?page_id=3',0,'page','',0),(5,1,'2018-09-08 19:56:15','2018-09-08 19:56:15','[tm_pb_section admin_label=\"section\"][tm_pb_row admin_label=\"row\"][tm_pb_column type=\"4_4\"][tm_pb_sidebar admin_label=\"Sidebar\" orientation=\"right\" area=\"cherry-sidebars-1\"] [/tm_pb_sidebar][/tm_pb_column][/tm_pb_row][/tm_pb_section]','Tienda','','publish','closed','closed','','tienda','','','2018-09-19 00:51:00','2018-09-19 00:51:00','',0,'http://localhost/wp/index.php/tienda/',0,'page','',0),(6,1,'2018-09-08 19:56:16','2018-09-08 19:56:16','[woocommerce_cart]','Carrito','','publish','closed','closed','','carrito','','','2018-09-08 19:56:16','2018-09-08 19:56:16','',0,'http://localhost/wp/index.php/carrito/',0,'page','',0),(7,1,'2018